import './Dash.css';
import HomedAsh from './Home/Main';
import GridLoader from 'react-spinners/GridLoader';
import '../Loading.css';

// View Dash 
export default function ReturndAsh() {

 const [loading, setLoading] = React.useState(false);

 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (

  <div>
   {
    loading ?
     <div className='App-loading'>
      <GridLoader
       size={15}
       color={'#00b8d4'}
       loading={loading}
      />
     </div>
     :

     <div className='wrp-dash-money'>
      <HomedAsh />
     </div>
   }
  </div>


 );
};
